<Table id="table" hoverable={true} shadow>
    <TableHead>
        <TableHeadCell>Aircraft</TableHeadCell>
        <!--  <TableHeadCell>Briefing</TableHeadCell>
        <TableHeadCell>Flight</TableHeadCell>
        <TableHeadCell>Debfiefing</TableHeadCell> -->
